import "../style.css";
import Col from "react-bootstrap/Col";
import Row from "react-bootstrap/Row";
import vector3 from "../images/Vector 3.png";
import vector4 from "../images/Vector 4.png";
import logo from "../images/logo.PNG";
import homepageIcon from "../images/homepage_icon.png";
import customerIcon from "../images/customer_icon.png";
import managerIcon from "../images/manager_icon.png";

import { Link } from "react-router-dom";
import { useUserContext } from "../contexts/AuthContext";

function SelectRole() {
  const { selectRole } = useUserContext();
  return (
    <div>
      <Row className=" ">
        <Col className="border col-12 justify-content-end d-flex">
          <img src={vector3} alt="Vector 3" className="" />
          <img src={vector4} alt="Vector 4" className="" />
        </Col>
        <Col className="border col-12 justify-content-center d-flex">
          <img src={logo} alt="logo" />
        </Col>
        <Col className="border d-flex justify-content-center col-12">
          <img src={homepageIcon} alt="logo" />
        </Col>
        <Col className="border d-flex justify-content-center">
          <h1
            style={{ marginRight: "60px", marginLeft: "60px" }}
            className="text-center border"
          >
            How would you like to register?{" "}
          </h1>
        </Col>
      </Row>
    </div>
  );
}

export default SelectRole;
